import React, { Component } from 'react';
import './Contact.css';

class Contact extends Component {
  render() {
    return (
      <div id={this.props.id} className="main-section Contact">

        <p className="copyright">&copy; 2018 Nancy Yao</p>
      </div>
    );
  }
}

export default Contact;
